■メーカー:森永製菓<br>■品名:86gマンナビスケット<br>■賞味期限：<br>■子育てに、いいコト、もっと。
離乳期に不足しがちな栄養素（カルシウム・鉄分・ビタミン）を配合したやさしい味わいのビスケットです。
７ヶ月頃から大人の方まで、ご家族でどうぞ。<br>アレルギー特定原材料：乳、小麦、大豆<br>卵を含む製品と共通の設備で製造しています。<br><br>【注意事項】<br>・お子様が横になっている時や、おんぶの時にはあげないでください。<br>・うまく飲みこめないことがありますので、お子様がのどにつまらせないよう必ずそばで見守ってあげてください。<br>・麦茶や湯ざましなどといっしょに食べさせてあげてください。<br>・1日0.5袋を目安にお召し上がりください。<br>・本品は、多量摂取により疾病が治癒したり、より健康が増進するものではありません。1日の摂取目安量を守ってください。<br>・1日当たりの栄養素等表示基準値に占める割合：カルシウム35%、鉄33%<br>・本品は、特定保健用食品と異なり、消費庁長官による個別審査を受けたものではありません。 <!--▼おすすめ商品（目玉商品機能）タイトル画像-->
