本鰹節、宗田鰹節、鯖節の３種類のだしに、まろやかで深みのある赤穂の塩を１００％使って、香り高く上品な味わいのつゆに仕上げました。<img src="http://image.rakuten.co.jp/cocodecow/cabinet/zaikocall.gif" width="303" height="100" border="0"><br />醤油を一切使っておりませんので、素材の色合いや風味を大事にする料理に重宝されております。また、麺類のつゆとしてお使いいただくと薬味の風味がグッと引き立ちます。また、大豆アレルギーのお客様にも大変ご好評をいただいております。●注文単位：１本（３００ｍｌ）<BR>●栄養成分（１００ｍｌ当り）：エネルギー　　５５Ｋｃａｌ、たんぱく質　　１．０ｇ、脂質　　０ｇ、炭水化物　　１２．８ｇ、ナトリウム　　３．７ｍｇ、食塩相当量　　９．４ｇ<BR>●原材料名：だし（そうだかつお節、さば節、かつお節）、砂糖、食塩、みりん、エキス（ちりめん、かつお節、こんぶ、焼あご、しいたけ）、酒精、調味料（アミノ酸等）、酸味料<BR>●アレルギー：さば<BR><BR>※メーカーの都合により、パッケージ・仕様等は予告なく変更になる場合がございます。<BR><BR><BR><BR><BR>ももや  モモヤ  ＭＯＭＯＹＡ  しおだしつゆ  シオダシツユ  塩出汁  ３００ミリリットル  和風調味料  わふうちょうみりょう  １本  食材  本鰹節  宗田鰹節  鯖節  ３種類のだし  塩出汁つゆ  しお出汁つゆ  つゆの素  つゆのもと  無添加  むてんか<style type="text/css">
